n\"}},{\"languageCode\":\"uk\",\"languageName\":{\"simpleText\":\"Ukrainian\"}},{\"languageCode\":\"ur\",\"languageName\":{\"simpleText\":\"Urdu\"}},{\"languageCode\":\"ug\",\"languageName\":{\"simpleText\":\"Uyghur\"}},{\"languageCode\":\"uz\",\"languageName\":{\"simpleText\":\"Uzbek\"}},{\"languageCode\":\"vi\",\"languageName\":{\"simpleText\":\"Vietnamese\"}},{\"languageCode\":\"cy\",\"languageName\":{\"simpleText\":\"Welsh\"}},{\"languageCode\":\"fy\",\"languageName\":{\"simpleText\":\"Western Frisian\"}},{\"languageCode\":\"xh\",\"languageName\":{\"simpleText\":\"Xhosa\"}},{\"languageCode\":\"yi\",\"languageName\":{\"simpleText\":\"Yiddish\"}},{\"languageCode\":\"yo\",\"languageName\":{\"simpleText\":\"Yoruba\"}},{\"languageCode\":\"zu\",\"languageName\":{\"simpleText\":\"Zulu\"}}],\"defaultAudioTrackIndex\":0}},\"videoDetails\":{\"videoId\":\"nR_28RIEGyw\",\"title\":\"On trial: Julian Assange and journalism | The Listening Post (Full)\",\"lengthSeconds\":\"1565\",\"keywords\":[\"youtube\",\"aljazeera.com\",\"julian assange\",\"aljazeera news\",\"al jazeera\",\"prison journalism\",\"aljazeera\",\"aljazeera english\",\"aljazeera live\",\"al jazeera english\"],\"channelId\":\"UCNye-wNBqNL5ZzHSJj3l8Bg\",\"isOwnerViewing\":false,\"shortDescription\":\"On The Listening Post this week: To extradite or not to extradite: Julian Assange's trial and its consequences for journalism. Plus, prison journalism in the US.\\n\\nOn trial: Julian Assange and journalism \\nWe begin with the legal fate of Julian Assange. This past week saw the commencement of a court case that will determine whether Britain should extradite the WikiLeaks founder to the United States.\\n\\nThe US government has charged Assange for his part in the release of classified military documents - he's looking at a maximum prison sentence of 175 years.\\n\\nAssange's advocates say he has little chance of getting a fair trial in the US and, if sent there, he could end up facing conditions amounting to torture.\\n\\nIt is a case against Julian Assange and, by implication, modern-day journalism.\\n\\nContributors:\\n\\nStefania Maurizi - Investigative journalist\\n\\nJames Ball - Global editor, The Bureau of Investigative Journalism\\n\\nRebecca Vincent - UK bureau director, Reporters Without Borders\\n\\nNils Melzer - UN special rapporteur on torture\\n\\nOn our radar:\\nRichard Gizbert speaks to producer Meenakshi Ravi about the \\\"Delhi Riots\\\" and the difficulties journalists are facing in trying to cover them.\\n\\nAmerica's Jailhouse Journalists\\nMore than two million people live within the American prison system. That is roughly equivalent to the population of a city like Las Vegas, imprisoned across the country.\\n\\nThe stories of what really goes on inside are seldom heard. For journalists who have tried, access is the issue, with prison authorities usually controlling who gets in and what stories get out.\\n\\nBut some prisoners are determined to make this a beat of their own. The journalism they produce behind bars is of real value, both for audiences and the reporters involved.\\n\\nThe Listening Post's Flo Phillips on the ultimate inside story - prison journalism in the US.\\n\\nContributors:\\n\\nJohn J Lennon - Inmate journalist from Sing Sing Prison \\u0026 contributing editor, Esquire Magazine\\n\\nTroy Williams - Founder, San Quentin Prison Report \\u0026 founder, Restorative Media Project\\n\\nKerry Myers - Former editor, The Angolite \\u0026 deputy executive director, The Parole Project\\n\\nSam Robinson - Information officer, San Quentin Prison\\n\\nYukari Iwatani Kane - Adviser, San Quentin News\\n\\n- Subscribe to our channel: http:\/\/aje.io\/AJSubscribe \\n- Follow us on Twitter: https:\/\/twitter.com\/AJEnglish \\n- Find us on Facebook: https:\/\/www.facebook.com\/aljazeera \\n- Check our website: https:\/\/www.aljazeera.com\/\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/nR_28RIEGyw\/hqdefault.j tion":{"runs":[{"text":"On The Listening Post this week: To extradite or not to extradite: Julian Assange's trial and its consequences for journalism. Plus, prison journalism in the US.\n\nOn trial: Julian Assange and journalism \nWe begin with the legal fate of Julian Assange. This past week saw the commencement of a court case that will determine whether Britain should extradite the WikiLeaks founder to the United States.\n\nThe US government has charged Assange for his part in the release of classified military documents - he's looking at a maximum prison sentence of 175 years.\n\nAssange's advocates say he has little chance of getting a fair trial in the US and, if sent there, he could end up facing conditions amounting to torture.\n\nIt is a case against Julian Assange and, by implication, modern-day journalism.\n\nContributors:\n\nStefania Maurizi - Investigative journalist\n\nJames Ball - Global editor, The Bureau of Investigative Journalism\n\nRebecca Vincent - UK bureau director, Reporters Without Borders\n\nNils Melzer - UN special rapporteur on torture\n\nOn our radar:\nRichard Gizbert speaks to producer Meenakshi Ravi about the \"Delhi Riots\" and the difficulties journalists are facing in trying to cover them.\n\nAmerica's Jailhouse Journalists\nMore than two million people live within the American prison system. That is roughly equivalent to the population of a city like Las Vegas, imprisoned across the country.\n\nThe stories of what really goes on inside are seldom heard. For journalists who have tried, access is the issue, with prison authorities usually controlling who gets in and what stories get out.\n\nBut some prisoners are determined to make this a beat of their own. The journalism they produce behind bars is of real value, both for audiences and the reporters involved.\n\nThe Listening Post's Flo Phillips on the ultimate inside story - prison journalism in the US.\n\nContributors:\n\nJohn J Lennon - Inmate journalist from Sing Sing Prison \u0026 contributing editor, Esquire Magazine\n\nTroy Williams - Founder, San Quentin Prison Report \u0026 founder, Restorative Media Project\n\nKerry Myers - Former editor, The Angolite \u0026 deputy executive director, The Parole Project\n\nSam Robinson - Information officer, San Quentin Prison\n\nYukari Iwatani Kane - Adviser, San Quentin News\n\n- Subscribe to our channel: "},{"text":"http://aje.io/AJSubscribe","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgCIhMIvI7PuMOa6gIVPgMGAB1X3Q9QSKy2kJCR3v2PnQE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?v=nR_28RIEGyw\u0026event=video_description\u0026q=http%3A%2F%2Faje.io%2FAJSubscribe\u0026redir_token=ufXcBMP3KoWZfn3K9wjVjcR0JMB8MTU5MzA5MDY5NEAxNTkzMDA0Mjk0","rootVe":83769}},"urlEndpoint":{"url":"/redirect?v=nR_28RIEGyw\u0026event=video_description\u0026q=http%3A%2F%2Faje.io%2FAJSubscribe\u0026redir_token=ufXcBMP3KoWZfn3K9wjVjcR0JMB8MTU5MzA5MDY5NEAxNTkzMDA0Mjk0","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":" \n- Follow us on Twitter: "},{"text":"https://twitter.com/AJEnglish","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgCIhMIvI7PuMOa6gIVPgMGAB1X3Q9QSKy2kJCR3v2PnQE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?v=nR_28RIEGyw\u0026event=video_description\u0026q=https%3A%2F%2Ftwitter.com%2FAJEnglish\u0026redir_token=ufXcBMP3KoWZfn3K9wjVjcR0JMB8MTU5MzA5MDY5NEAxNTkzMDA0Mjk0","rootVe":83769}},"urlEndpoint":{"url":"/redirect?v=nR_28RIEGyw\u0026event=video_description\u0026q=https%3A%2F%2Ftwitter.com%2FAJEnglish\u0026redir_token=ufXcBMP3KoWZfn3K9wjVjcR0JMB8MTU5MzA5MDY5NEAxNTkzMDA0Mjk0","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":" \n- Find us on Facebook: "},{"text":"https://www.facebook.com/aljazeera","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgCIhMIvI7PuMOa6gIVPgMGAB1X3Q9QSKy2kJCR3v2PnQE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?v=nR_28RIEGyw\u0026event=video_description\u0026q=https%3A%2F%2Fwww.facebook.com%2Faljazeera\u0026redi eText":"Urdu"}},{"languageCode":"ug","languageName":{"simpleText":"Uyghur"}},{"languageCode":"uz","languageName":{"simpleText":"Uzbek"}},{"languageCode":"vi","languageName":{"simpleText":"Vietnamese"}},{"languageCode":"cy","languageName":{"simpleText":"Welsh"}},{"languageCode":"fy","languageName":{"simpleText":"Western Frisian"}},{"languageCode":"xh","languageName":{"simpleText":"Xhosa"}},{"languageCode":"yi","languageName":{"simpleText":"Yiddish"}},{"languageCode":"yo","languageName":{"simpleText":"Yoruba"}},{"languageCode":"zu","languageName":{"simpleText":"Zulu"}}],"defaultAudioTrackIndex":0}},"videoDetails":{"videoId":"nR_28RIEGyw","title":"On trial: Julian Assange and journalism | The Listening Post (Full)","lengthSeconds":"1565","keywords":["youtube","aljazeera.com","julian assange","aljazeera news","al jazeera","prison journalism","aljazeera","aljazeera english","aljazeera live","al jazeera english"],"channelId":"UCNye-wNBqNL5ZzHSJj3l8Bg","isOwnerViewing":false,"shortDescription":"On The Listening Post this week: To extradite or not to extradite: Julian Assange's trial and its consequences for journalism. Plus, prison journalism in the US.\n\nOn trial: Julian Assange and journalism \nWe begin with the legal fate of Julian Assange. This past week saw the commencement of a court case that will determine whether Britain should extradite the WikiLeaks founder to the United States.\n\nThe US government has charged Assange for his part in the release of classified military documents - he's looking at a maximum prison sentence of 175 years.\n\nAssange's advocates say he has little chance of getting a fair trial in the US and, if sent there, he could end up facing conditions amounting to torture.\n\nIt is a case against Julian Assange and, by implication, modern-day journalism.\n\nContributors:\n\nStefania Maurizi - Investigative journalist\n\nJames Ball - Global editor, The Bureau of Investigative Journalism\n\nRebecca Vincent - UK bureau director, Reporters Without Borders\n\nNils Melzer - UN special rapporteur on torture\n\nOn our radar:\nRichard Gizbert speaks to producer Meenakshi Ravi about the \"Delhi Riots\" and the difficulties journalists are facing in trying to cover them.\n\nAmerica's Jailhouse Journalists\nMore than two million people live within the American prison system. That is roughly equivalent to the population of a city like Las Vegas, imprisoned across the country.\n\nThe stories of what really goes on inside are seldom heard. For journalists who have tried, access is the issue, with prison authorities usually controlling who gets in and what stories get out.\n\nBut some prisoners are determined to make this a beat of their own. The journalism they produce behind bars is of real value, both for audiences and the reporters involved.\n\nThe Listening Post's Flo Phillips on the ultimate inside story - prison journalism in the US.\n\nContributors:\n\nJohn J Lennon - Inmate journalist from Sing Sing Prison \u0026 contributing editor, Esquire Magazine\n\nTroy Williams - Founder, San Quentin Prison Report \u0026 founder, Restorative Media Project\n\nKerry Myers - Former editor, The Angolite \u0026 deputy executive director, The Parole Project\n\nSam Robinson - Information officer, San Quentin Prison\n\nYukari Iwatani Kane - Adviser, San Quentin News\n\n- Subscribe to our channel: http://aje.io/AJSubscribe \n- Follow us on Twitter: https://twitter.com/AJEnglish \n- Find us on Facebook: https://www.facebook.com/aljazeera \n- Check our website: https://www.aljazeera.com/","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/nR_28RIEGyw/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLBp8Oql7GARdXraoLICI-_XRJc3Eg","width":168,"height":94},{"url":"https://i.ytimg.com/vi/nR_28RIEGyw/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLCrSCsANq0nU-mdEkff37F_RaiYjw","width":196,"height":110},{"url":"https://i.ytimg.com/vi/ l: Julian Assange and journalism \nWe begin with the legal fate of Julian Assange. This past week saw the commencement of a court case that will determine whether Britain should extradite the WikiLeaks founder to the United States.\n\nThe US government has charged Assange for his part in the release of classified military documents - he's looking at a maximum prison sentence of 175 years.\n\nAssange's advocates say he has little chance of getting a fair trial in the US and, if sent there, he could end up facing conditions amounting to torture.\n\nIt is a case against Julian Assange and, by implication, modern-day journalism.\n\nContributors:\n\nStefania Maurizi - Investigative journalist\n\nJames Ball - Global editor, The Bureau of Investigative Journalism\n\nRebecca Vincent - UK bureau director, Reporters Without Borders\n\nNils Melzer - UN special rapporteur on torture\n\nOn our radar:\nRichard Gizbert speaks to producer Meenakshi Ravi about the \"Delhi Riots\" and the difficulties journalists are facing in trying to cover them.\n\nAmerica's Jailhouse Journalists\nMore than two million people live within the American prison system. That is roughly equivalent to the population of a city like Las Vegas, imprisoned across the country.\n\nThe stories of what really goes on inside are seldom heard. For journalists who have tried, access is the issue, with prison authorities usually controlling who gets in and what stories get out.\n\nBut some prisoners are determined to make this a beat of their own. The journalism they produce behind bars is of real value, both for audiences and the reporters involved.\n\nThe Listening Post's Flo Phillips on the ultimate inside story - prison journalism in the US.\n\nContributors:\n\nJohn J Lennon - Inmate journalist from Sing Sing Prison \u0026 contributing editor, Esquire Magazine\n\nTroy Williams - Founder, San Quentin Prison Report \u0026 founder, Restorative Media Project\n\nKerry Myers - Former editor, The Angolite \u0026 deputy
